            <div className="row">
                <div className="col-xs-offset-2 col-xs-8">
                    <div className="page-header">
                        <h2>React Router Demo</h2>
                        <button>后退</button>
                        <button>前进</button>
                        <button>go</button>
                    </div>
                </div>
            </div>
        )
    }
}

export default withRouter(Header)
